import { Button, ButtonPositionType } from "primereact";
export interface ButtonModels {
  type: any;
  label: string;
  icon: string;
  iconsPos: ButtonPositionType;
  styles: React.CSSProperties;
  handleClick?(): void;
}
export const ButtonPrimary = (data: ButtonModels) => {
  const { type, label, icon, iconsPos, handleClick, styles } = data;
  return (
    <Button
      type={type}
      label={label}
      icon={icon}
      iconPos={iconsPos}
      onClick={handleClick}
      style={styles}
    />
  );
};
